@StoneT2000 One minor tidbit (if you don't mind):

From Simon's screenshot, it's really hard to actually know where I should look if I only have 6 seconds to review your resume. Ideally, you want the recruiter's eyes to be naturally drawn to the most important parts (or have a clear pathway to it), but in this case it takes a second or two to even realize the layout of your resume and figure out what one should focus on.

Building on that (and this is highly subjective), you can take advantage of bolding contrast to really focus on the details that matter most in the 6 second window you'll have - it's a handful to read your full title @ company, but if I see <big company> on your resume that's already like an auto-pass to begin with - maybe try having only those bolded?
